import Counter from "./components/counter/counter";
import { useState } from "react";

function App() {
  return (
    <div className="App">
      <h1>Component Library Demo</h1>
        <h2>Buttons</h2>
      <div className="component-buttons">
      </div>
      <Counter starting={0} min={0} max={10} amount={2}/>
    </div>
  );
}

export default App;
